DROP FUNCTION IF EXISTS processprofit;
DELIMITER //

CREATE FUNCTION processprofit ( prc decimal(8,2), pft decimal(8,2))
RETURNS decimal(8,2)

BEGIN

   DECLARE prcprofit decimal(8,2);

   IF prc < 0.00 THEN
      SET prcprofit = prc;
   ELSE
      SET prcprofit = pft;
   END IF;
   RETURN prcprofit;

END; //

DELIMITER ;
